export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {

  const onNameChange = (event) => {
    setName(event.target.value);
  }


  return (
    <div>
      <form>
        <input value={name} onChange={onNameChange} />
        <input />
        <input />
      </form>
    </div>
  );
};
